import React from 'react';
import './App.css';

function App() {

  const Player = () => {
    return (
        <div className="player">
          <span className="player-name">
            Sherry
          </span>
          <div className="counter">
            <button> - </button>
            <button> + </button>
          </div>
        </div>
      );
  }

  return (
    <div className="App">
      <header className="App-header">
        <h1>Scoreboard</h1>
        <span className="stats">Players: 1</span>
         <div className="player">
        <span className="player-name">
          { Player() }
        </span>
      </div>
      </header>

    </div>
  );
}

export default App;
